How to save properly to mongodb?<p>So this is my first time using MongoDB and I'm having an issue with saving into a document</p>

<p>Saving method</p>

<pre><code>    public void addStamp(UUID playerUUID, UUID issuedByUUID, String playerCountry, String enteringCountry, String enteringCity, boolean isEntry, Date date) {
        Document document = getPassport(playerUUID, playerCountry);

        DBObject stamp = new BasicDBObject("stampFor", enteringCountry)
                .append("cityEntered", enteringCity)
                .append("issuedBy", issuedByUUID)
                .append("isEntry", isEntry)
                .append("date", date);

        List&lt;DBObject&gt; stamps = (List&lt;DBObject&gt;) document.get("stamps");
        stamps.add(stamp);

        mongoCollection.updateOne(document, new Document("$set", new Document("stamps", stamps)));
    }
</code></pre>

<p>Method that gets the passport (getPassport)</p>

<pre><code>    public Document getPassport(UUID uuid, String country) {
        List&lt;Document&gt; list;

        if (get(uuid, "passports") != null) list = get(uuid, "passports");
        else return null;

        for (Document document : list) {
            if (document.getString("country").equalsIgnoreCase(country))
                return document;
        }
        return null;
    }
</code></pre>

<p>The get method</p>

<pre><code>    public &lt;T&gt; T get(UUID uuid, String key) {
        Document document = mongoCollection.find(new Document("UUID", uuid)).first();

        if (document == null) return null;
        if (document.get(key) == null) return null;

        return (T) document.get(key);
    }
</code></pre>

<p>How the document is structured,</p>

<pre><code>{
    "_id": {
        "$oid": "5e71c1ea12ee5455287a968f"
    },
    "UUID": {
        "$uuid": "12642edb-f181-4fbf-bfff-642097f1cc69"
    },
    "passports": [
        {
            "country": "usa",
            "issuedBy": {
                "$uuid": "12642edb-f181-4fbf-bfff-642097f1cc69"
            },
            "city": "nyc",
            "date": {
                "$date": "2020-03-18T06:38:34.734Z"
            },
            "stamps": []
        }
    ]
}
</code></pre>

<p>What I'm trying to do is edit the stamps part of the document, but with the code I have, it executes with no issues but it does no changes to the documents, I'm not sure what the issue is.</p>

