Add duration to a date mongodb<p>I try to learn to work with mongodb and nodejs and i have a problem.
I have a table in mongoDB called Schedule with fields id, start and end. For a specific row, I want to add to the start time a duration as long as the start time is lower than end.</p>

<p>Ex. I have the row in Schedule table: </p>

<pre><code>{
   "_id": "123", 
   "start": "2020-03-11T09:00:00.000Z", 
   "end": "2020-03-11T18:00:00.000Z"
} 
</code></pre>

<p>an duration parameter 30 minutes (30x60x1000ms). I want to obtain following result: </p>

<pre><code>[
 {"id":1, "time":"2020-03-11T09:00:00.000Z"}, 
 {"id":2, "time":"2020-03-11T09:30:00.000Z"}, 
 {"id":3, "time":"2020-03-11T10:00:00.000Z"}, 
 {"id":4, "time":"2020-03-11T10:30:00.000Z"},   
 {"id":5, "time":"2020-03-11T11:00:00.000Z"},
 ...
 {"id":n, time:"2020-03-11T18:00:00.000Z}
]
</code></pre>

<p>I tried with $add aggregation, but i obtain just the first row.</p>

<pre><code>const {idSchedule} = req.params;
const {duration} = req.body;
const durationMs = duration*60*1000;
console.log('duration',duration);
objId = new ObjectID(idSchedule); 
Schedule.aggregate([
   { "$match":{
        "_id": objId,
        }
    },
   { $project: { _id: 1, time: { $add: [ "$start", durationMs ] } } }
]).then((response) =&gt; {
    res.send(response)
})
</code></pre>

<p>And i obtain just: </p>

<pre><code>[
 {
    "_id": "5e68ebf0992e173a28e7dd46",
    "time": "2020-03-11T09:30:00.000Z"
 }
]
</code></pre>

<p>Thank you very much!</p>

