How to select parent based on children's value using mongoose and GraphQL?<p>I'm trying to achieve something equivalent to a conditional JOIN query, but then with GraphQL.
I'm using Mongoose for my db model and MongoDB as database.</p>

<p>I'll illustrate my problem with the following graphQL schema:</p>

<pre><code>type Booking {
    _id: ID!
    client: Client!
    rooms: Room!
    activities: Activity!
    nrOfAdults: Int!
    arrivalDate: String!
    departureDate: String!
}

type Room {
  _id: ID!
  name: String!
  contents: String
  priceNight: Float!
  maxAdults: Int!
  reservations: [Booking]
}

</code></pre>

<p>The Mongoose schema:</p>

<pre><code>const bookingSchema = new Schema(
  {
    client: {
      type: Schema.Types.ObjectId,
      ref: 'Client'
    },
    rooms: [{
      type: Schema.Types.ObjectId,
      ref: 'Rooms'
    }],
    nrOfAdults: {
      type: Number,
      required: true
    },
    arrivalDate: {
      type: Date,
      required: true
    },
    departureDate: {
      type: Date,
      required: true
    }
  },
  { timestamps: true }
);

const roomSchema = new Schema({
  name: {
    type: String,
    required: true
  },
  priceNight: {
    type: Number,
    required: true
  },
  maxAdults: {
    type: Number,
    required: true
  },
  reservations: [
    {
      type: Schema.Types.ObjectId,
      ref: 'Booking'
    }
  ]
});
</code></pre>

<p>I can query rooms, for example, if I want to get the rooms for 3 or more adults I run:</p>

<pre><code>       Room.find({
         maxAdults: { $gte: 3 }
       });
</code></pre>

<p>This works fine.</p>

<p>However, I'd also like to show the <strong>available</strong> rooms, which means I need to impose a condition on the booking objects which are hold in <em>reservation</em>.
I thought this would be fairly easy, using something like:</p>

<pre><code>       Room.find({
         maxAdults: { $gte: 3 },
         reservations: { $elemMatch: { arrivalDate: { $gte: *some date*}}}
       });
</code></pre>

<p>But it returns an empty array, while it should return some value, based on the data in mongodb:</p>

<p>To make things a little more clear, I'd like to achieve the same outcome as the following SQL query would give me:</p>

<pre><code>SELECT *
FROM room
JOIN booking ON room.id = booking.roomId
WHERE
room.maxAdults &gt;= 3
AND
(
booking.arrivalDate &gt; CAST('2020-05-15' AS DATE)
OR
booking.departureDare &lt; CAST(2020-05-06' AS DATE)
)
</code></pre>

